export function adding() {
  return (dispatch) => {
    fetch(`https://sugoku.herokuapp.com/board?difficulty=${diff}`)
      .then((res) => res.json())
      .then((data) => {
        dispatch({
          type: "GET_BOARD",
          getBoard: data.board,
        });
      })
      .catch((err) => {
        console.log(err);
      });
  };
}
